import React from "react";
import { login } from '../utils';

/**
 * Barre de navigation
 *
 */
function NavBar({ totalCounters }) {
  return (
    <nav className="navbar navbar-light bg-light">
      <div className="navbar-brand">
        <i className="fa fa-shopping-cart fa-lg m-2" aria-hidden="true" />
        <span className="badge badge-pill badge-info m-2" style={{ width: 50 }}>
          {totalCounters}
        </span>
        Items
      </div>
      <div className="container-fluid text-center">
            <div className="row">
                <div className="col-12">
                    <h1 className="bp-5 mb-5">Accès au système de vote</h1>
                    <button onClick={() => handleLogin()} className="btn-primary rounded text-center">Se connecter</button>
                </div>
            </div>
        </div>
    </nav>
  );
}

export default NavBar;
